import './App.css';
import Dashboard from './dasboahrd/Dasboard';
import NavbarMenu from './NavBar/navbar';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Trabajadores from './Trabajadores/trabajadores';
import Evaluacion from './Evaluacion/evaluacion';

const App = () => {
  return (
    <Router>
      <NavbarMenu />
      <Route path="/" exact component={Dashboard} />
      <Route path="/Trabajadores" exact component={Trabajadores} />
      <Route path="/Evaluacion" exact component={Evaluacion} />
    </Router>
  );
}

export default App;
